    public static int lengthOfLongestSubstring(String s) {
        int[] cnt = new int[256];
        char[] sc = s.toCharArray();

        int ans = 0 , l = 0, r = 0;
        while (r<sc.length){
            char c = sc[r];
            cnt[c]++;
            while (cnt[c] > 1) {
                cnt[sc[l]]--;
                l++;
            }
            ans = Math.max(ans, r - l + 1);
            r++;
        }
        return ans;
    }

